      out.write("              <td class=\"body-item mbr-fonts-style display-7\">Festival of Innovation &amp; Entrepreneurship (FINE)</td><td class=\"body-item mbr-fonts-style display-7\">NIF</td><td class=\"body-item mbr-fonts-style display-7\">The Festival of Innovation &amp; Entrepreneurship (FINE) {previously known as Festival of Innovation FOIN)} is a unique initiative of the Office of the President of India to recognise, respect and reward grassroots innovations and foster a supportive ecosystem. Hosted in the month of March at The President's House, the FOIN has become a national celebration of creativity and innovation at and for grassroots.</td><td class=\"body-item mbr-fonts-style display-7\">March 19-21, 2018</td><td class=\"body-item mbr-fonts-style display-7\"><a href=\"http://nif.org.in/event/102\" target=\"_blank\">http://nif.org.in/event/102</a></td></tr><tr>\n");
