      out.write("              <td class=\"body-item mbr-fonts-style display-7\">SPIEF 2O17</td><td class=\"body-item mbr-fonts-style display-7\">MAKE IN INDIA</td><td class=\"body-item mbr-fonts-style display-7\">As St. Petersburg International Economic Forum (SPIEF) 2017 set its stage to gather leading decision-makers of emerging economic powers, India geared up to participate as a Guest Country. Indian Prime Minister Narendra Modi was invited as Guest of Honour. This year also marked the completion of 70 long years diplomatic ties between India and Russia. Today, the relationship between India and Russia has progressed beyond the traditional pillars of defence and space to robust cooperation in civil nuclear, collaboration in hydrocarbons and a long term interest in LNG sourcing.</td><td class=\"body-item mbr-fonts-style display-7\">January<br>23-26 ,2017</td><td class=\"body-item mbr-fonts-style display-7\"><a href=\"http://www.makeinindia.com/spief-2017\" target=\"_blank\">http://www.makeinindia.com/spief-2017</a></td></tr><tr>\n");
